import './card.css';

function Card({ date, title, content }) {
  return (
    <div className="cards">
      <div className="header_cards">
        <span>{date}</span>
        <img src="./heart_filled.svg" alt="" />
      </div>
      <h1>{title}</h1>
      <p>{content}</p>
    </div>
  );
}

export default Card;
